 ('1', '1', 'en_us', NULL, NULL, '4252718460', '0', 'Developer', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam accumsan lectus nibh, at vehicula nunc consectetur eu. Nullam at tellus fermentum, interdum arcu ut, tincidunt diam. Phasellus semper purus eleifend odio efficitur, vel rhoncus nibh consectetur. Sed porttitor dui id tellus condimentum dignissim. Morbi in consectetur nisl, nec porttitor erat. Donec et lacus vitae massa pellentesque pulvinar. Nullam finibus vehicula nibh a imperdiet. Pellentesque ac suscipit massa. Nulla facilisi.', '0', NULL, NULL, '2016-02-05 02:57:27', '2016-03-22 21:01:31', '4deb1ed6-d21a-4d59-b326-aaa844d35b04'),
 ('2', '2', 'en_us', 'Welcome to Test.partneur.dr2dev.com!', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Test.partneur.dr2dev.com will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, '0', NULL, NULL, '0', NULL, NULL, '2016-02-05 02:57:28', '2016-02-05 02:57:28', '82abc260-7814-44c3-a598-0de7ce983f91'),
 ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Test.partneur.dr2dev.com. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, '0', NULL, NULL, '0', NULL, NULL, '2016-02-05 02:57:28', '2016-02-05 02:57:28', '18f1900d-0c7c-41dd-b3db-670a7c7bff17'),
 ('4', '4', 'en_us', NULL, NULL, '2066012264', '0', 'Chief Programmer / Developer', 'Mike Cramblett is a programmer, database developer and Google Adwords specialist. He graduated from Harvey Mudd College with a BS in Computer Science in ’02, where he had the distinct honor of being the senior commencement speaker at graduation. He told his fellow classmates to follow their dreams and pursue their passions.\r\nBetween ’05 and ’14 he was the sole proprietor of an Adwords business focused on affiliate marketing that had a total budget of half a million dollars and received over six million clicks. He wrote a suite of custom software tools to automate the discovery of new keywords and to manage the day to day operations. Mike is also a standup comedian in his spare time.', '0', NULL, NULL, '2016-02-05 02:59:25', '2016-03-22 20:30:51', '654578a0-ddc4-4d8a-b2b2-612b4e0825fb'),
 ('5', '5', 'en_us', 'This is a test', '<p>I am a test news update created by an <strong>admin</strong> to talk to the <em>userbase</em>.</p>', NULL, '0', NULL, NULL, '0', NULL, NULL, '2016-02-09 00:24:16', '2016-04-10 00:52:31', '5f196908-7c1f-4606-8b19-f02256a692ef'),
